INSERT INTO `libro` (`idlibro`, `titulo`, `isbn`, `descripcion`, `portada`, `pdflibro`, `year`, `autor`, `categoria`, `editorial`, `estado`) VALUES
(1, 'Politica', '2147483647', 'Política reúne los escritos que Aristóteles (384-322 a. C.) dedicó a la vida en sociedad y la organización de la convivencia cívica. Una suma de tratados menores de sorprendente riqueza de temas, expuestos con la agudeza y profundidad que caracteriza el pensamiento aristotélico. El discípulo de Platón comienza analizando las estructuras básicas de la sociedad, en la que la ciudad representa el logro más cabal: el hombre está definido como un ser cívico, zoon politikón, y por encima de la familia, la tribu y la aldea se perfila la polis como el ámbito autosuficiente de la cultura y la vida feliz. Tras pasar revista a los distintos tipos de gobierno, se muestra partidario de la democracia moderada, la clase media, el equilibrio de poderes y una constitución mixta. Señala después los rasgos que definen al ciudadano en su participación en la tareas comunitarias, e insiste en la importancia de la educación para mantener y mejorar esa vida digna y libre. De temperamento moderado y liberal, A', , 'aristoteles-politica.pdf', 2001, 'Aristoteles', 'Politica', 'Iberia', 'A');
INSERT INTO `libro` (`idlibro`, `titulo`, `isbn`, `descripcion`, `portada`, `pdflibro`, `year`, `autor`, `categoria`, `editorial`, `estado`) VALUES
(2, 'La Iliada', '9780694517008', 'La Ilíada es una epopeya griega y el poema más antiguo escrito de la\r\nliteratura occidental. Se atribuye tradicionalmente a Homero.\r\nCompuesta en hexámetros dactílicos, consta de 15 693 versos\r\n(divididos por los editores, ya en la antigüedad, en 24 cantos o\r\nrapsodias) y su trama radica en la cólera de Aquiles (μῆνις, mênis).\r\nNarra los acontecimientos ocurridos durante 51 días en el décimo y\r\núltimo año de la guerra de Troya. El título de la obra deriva del\r\nnombre griego de Troya, Ιlión.', , 'homero-la-iliada.pdf', 1996, 'Homero', 'Literatura Griega', 'Debolsillo', 'A');
INSERT INTO `libro` (`idlibro`, `titulo`, `isbn`, `descripcion`, `portada`, `pdflibro`, `year`, `autor`, `categoria`, `editorial`, `estado`) VALUES
(3, 'La interpretación de los sueños', '9781400101665', 'La primera edición de Die Traumdeutung (La interpretación de los sueños) se publicó unos días antes del siglo, aunque en la portada constara ya la fecha «1900». Es posible observar en esta pequeña licencia algún indicio del valor inaugural que el mismo Freud, clarividente, reservaba a su obra cumbre. La primera edición tuvo una desastrosa acogida por parte del público y la crítica. En una carta a su amigo Fliess, pocos días después de la publicación del libro, el autor se lamentaba: «No hemos adelantado demasiado a nuestro tiempo?». No obstante era también consciente de que, de uno u otro modo, el enigma de los sueños había sido por fin desvelado y que el destino de La interpretación de los sueños era convertirse inexorablemente, en la obra pionera del psicoanálisis. ', , 'freud-sigmund-la-interpretacion-de-los-suenos.pdf', 1899, 'Sigmund Freud', 'Psicologia', 'Franz Deuticke', 'A');

